import React from "react";
import './index.css';
import Todo from "./Todo";

function App() {
  const todo = {};
  todo.id = 0;
  todo.text = "";
  todo.status = false;

  return (
    <React.Fragment>
      <h1 id="title">Todo App</h1>
      <input></input>
      <button>Add</button>
      <Todo/>
    </React.Fragment>
  );
}

export default App;
